function CreateR6D(parent,part0,part1,C0P,C0A,C1P,C1A)
local weld=Instance.new("Motor6D")
weld.Parent=parent
weld.Part0=part0
weld.Part1=part1
weld.Name="What Weld"
weld.C1=C1P*C1A
weld.C0=C0P*C0A
return weld
end

function CreateWeld(parent,part0,part1,C0P,C0A,C1P,C1A)
local weld=Instance.new("Weld")
weld.Parent=parent
weld.Part0=part0
weld.Part1=part1
weld.Name="What Weld"
weld.C1=cf(C1X,C1Y,C1Z)*angles(C1Xa,C1Ya,C1Za)
weld.C0=cf(C0X,C0Y,C0Z)*angles(C0Xa,C0Ya,C0Za)
return weld
end

function CreatePart(parent,transparency,reflectance,material,col,size,name)
local p=Instance.new("Part")
p.TopSurface=0
p.Name=name
p.BottomSurface=0
p.Parent=parent
p.Size=size
p.Transparency=transparency
p.Reflectance=reflectance
p.CanCollide=false
p.Locked=false 
p.Massless=true 
p.Anchored=true 
p.Color=col 
p.Material=material
return p
end





