--// Clean Up Everything Before Stopping And Respawning
function StopScript()
for _,v in game.Players.LocalPlayer.Character:GetDescendants() do 
if v:isA("Trail") then 
v:Destroy()
end
end
for _,v in workspace:GetChildren() do 
if v:GetAttribute("VFX")==true then 
v:Destroy()
print("Deleted")
end
end
for _,v in workspace:GetChildren() do 
if v:GetAttribute("Main") then 
v:Destroy()
end
end
if Seek0 then
Seek0:Disconnect()
Seek0=nil
end
if Seek1 then
Seek1:Disconnect()
Seek1=nil
end
if Seek2 then
Seek2:Disconnect()
Seek2=nil
end
local gui=game:GetService("CoreGui")
local MainGui=gui:FindFirstChild("MainGui")
if MainGui then 
MainGui:Destroy()
end
if Running then
Running=false
tspawn(function()
for _=0,1 do 
Respawn()
twait()
end
end)
end
wait()
if Mode~="None" then
Mode="None"
print(Mode)
end
tclear(VFXTables)
if IsRendering then
IsRendering:Disconnect()
IsRendering=nil
end
if IsKeys then
IsKeys=nil
end
pcall(function()
game.SoundService:FindFirstChild("GlitcherAudioPlayer").TimePosition=0
